import React from 'react';
import { DiaryType } from '../types';



const Diary = ( { diary }: { diary: DiaryType } ) => {

    return (
      <div>
        <h3>{diary.date}</h3>
  {diary.weather}<br />
  {diary.visibility}<br />
      </div>
    )
  }

  export default Diary
